import React from 'react';
const InNum = () =>{
    console.log('done');
}

const App = () =>{
    return(
        <>
        <h1 className="head"></h1>
        <input
            type="text"
            placeholder="Enter Your Name"
            onChange={InputEvent}
            value={name}
        />
        <button onClick={InNum}></button>
        </>
    );
}

export default App;
